import React from "react";
import { useMemo } from "react";

function Map() {
  const center = useMemo(() => ({ lat: 44, lng: -80 }), []);
  return <div>
    <GoogleMap zoom={10} center={center} mapContainerClassName="map-container">
//       <Marker position={center} />
//     </GoogleMap>
    Map</div>;
}

export default Map;
